import React, { Suspense, lazy } from 'react'
import history from './history'

const HomeLazy = lazy(() => import('./components/Pages/Home/Home'))
const LogsLazy = lazy(() => import('./components/Pages/Login/Login'))

function App() {
  return (
    <Router history={history}>
      <Suspense fallback={<PageLoader />}>
        <Switch>
          <Route exact path='/'>
            <PublicLayout>
              <HomeLazy />
            </PublicLayout>
          </Route>
        </Switch>
      </Suspense>
    </Router>
  )
}

export default App
